summary:
Within the Operations department of Wolters Kluwer L&R US, International Group, I manage the content supply chain from manuscript delivery to final print and online products, with a focus on shortening production leadtimes, reducing costs, and improving quality and user satisfaction. 
My core responsibilities and achievements:
•	Successfully outsourcing production activities; 
•	(Re)designing, improving and automating end-to-end processes;
•	Building and maintaining mutually beneficial relationships with international vendors.
